import React from "react";

function Title(){
    return(
        <>
            <label for="clientName">Client : </label>
            <input name="clientName" type="text"></input>

            <label for="vacancyName">Vacancy : </label>
            <input for="vacancyName"></input>
        </>
    );
}


export default Title;
